import React from 'react';

export default function SearchBar(props){
  return (
    <form onSubmit={(e) => {
      e.preventDefault();
      props.onSearch();
    }}>
      <input type='text' />
      <input
        type='submit'
        value='buscar'
      />
    </form>
  )
}
